import React from 'react'
import Navbar from './Navbar';

export default function CreateNewQuiz() {
    const title = JSON.parse(localStorage.getItem("title"))[0]
    const description = JSON.parse(localStorage.getItem("description"))[0]

    console.log(title, description)

    return (
        <>
            <Navbar />

            <div name="container" className="h-[calc(100%-80px)] pl-[180px] pr-[180px] flex overflow-y-auto">
                <div className="text-[60px] text-center">Create a new quiz</div>

            </div>
        </>
    )
}
